import React, { useState, useEffect } from 'react';
import {
  View,
  StyleSheet,
  ScrollView,
  ActivityIndicator,
  Alert,
} from 'react-native';
import { Text, Button, Icon, Card } from 'react-native-elements';
import { StackNavigationProp } from '@react-navigation/stack';
import { RootStackParamList } from '../types/navigation';
import { theme } from '../theme/theme';
import { LinearGradient } from 'expo-linear-gradient';
import AsyncStorage from '@react-native-async-storage/async-storage';
import axios from 'axios';

type ClearCacheScreenProps = {
  navigation: StackNavigationProp<RootStackParamList, 'ClearCache'>;
};

interface CacheSize {
  images: number;
  data: number;
  documents: number;
  total: number;
}

interface CacheItem {
  id: string;
  label: string;
  icon: string;
  size: number;
  color: string;
  type: 'images' | 'data' | 'documents';
}

const ClearCacheScreen: React.FC<ClearCacheScreenProps> = ({ navigation }) => {
  const [loading, setLoading] = useState(true);
  const [clearing, setClearing] = useState<string | null>(null);
  const [cacheSize, setCacheSize] = useState<CacheSize | null>(null);

  useEffect(() => {
    loadCacheSize();
  }, []);

  const loadCacheSize = async () => {
    try {
      setLoading(true);
      const token = await AsyncStorage.getItem('authToken');

      if (!token) {
        Alert.alert('Error', 'Authentication required');
        navigation.goBack();
        return;
      }

      const response = await axios.get('http://localhost:3000/api/settings/cache/size', {
        headers: { Authorization: `Bearer ${token}` },
      });

      setCacheSize(response.data);
    } catch (error) {
      console.error('Error loading cache size:', error);
      Alert.alert('Error', 'Failed to load cache information');
    } finally {
      setLoading(false);
    }
  };

  const formatBytes = (bytes: number): string => {
    if (bytes === 0) return '0 Bytes';

    const k = 1024;
    const sizes = ['Bytes', 'KB', 'MB', 'GB'];
    const i = Math.floor(Math.log(bytes) / Math.log(k));

    return parseFloat((bytes / Math.pow(k, i)).toFixed(2)) + ' ' + sizes[i];
  };

  const handleClearCache = async (type?: 'images' | 'data' | 'documents') => {
    const typeLabel = type ? type.charAt(0).toUpperCase() + type.slice(1) : 'All';

    Alert.alert(
      `Clear ${typeLabel} Cache`,
      `Are you sure you want to clear ${type ? typeLabel.toLowerCase() + ' cache' : 'all cached data'}? This action cannot be undone.`,
      [
        {
          text: 'Cancel',
          style: 'cancel',
        },
        {
          text: 'Clear',
          style: 'destructive',
          onPress: async () => {
            try {
              setClearing(type || 'all');
              const token = await AsyncStorage.getItem('authToken');

              if (!token) {
                Alert.alert('Error', 'Authentication required');
                return;
              }

              await axios.post(
                'http://localhost:3000/api/settings/cache/clear',
                { type: type || 'all' },
                {
                  headers: { Authorization: `Bearer ${token}` },
                }
              );

              Alert.alert('Success', `${typeLabel} cache cleared successfully`);
              await loadCacheSize();
            } catch (error) {
              console.error('Error clearing cache:', error);
              Alert.alert('Error', 'Failed to clear cache');
            } finally {
              setClearing(null);
            }
          },
        },
      ]
    );
  };

  if (loading) {
    return (
      <View style={styles.loadingContainer}>
        <ActivityIndicator size="large" color={theme.colors.primary} />
        <Text style={styles.loadingText}>Loading cache information...</Text>
      </View>
    );
  }

  if (!cacheSize) {
    return (
      <View style={styles.loadingContainer}>
        <Icon name="error-outline" type="material" size={64} color={theme.colors.textSecondary} />
        <Text style={styles.errorText}>Failed to load cache information</Text>
        <Button
          title="Try Again"
          onPress={loadCacheSize}
          buttonStyle={styles.retryButton}
        />
      </View>
    );
  }

  const cacheItems: CacheItem[] = [
    {
      id: 'images',
      label: 'Images Cache',
      icon: 'image',
      size: cacheSize.images,
      color: '#2196F3',
      type: 'images',
    },
    {
      id: 'data',
      label: 'App Data Cache',
      icon: 'storage',
      size: cacheSize.data,
      color: '#4CAF50',
      type: 'data',
    },
    {
      id: 'documents',
      label: 'Documents Cache',
      icon: 'description',
      size: cacheSize.documents,
      color: '#FF9800',
      type: 'documents',
    },
  ];

  return (
    <View style={styles.container}>
      <LinearGradient
        colors={['#667eea', '#764ba2']}
        start={{ x: 0, y: 0 }}
        end={{ x: 1, y: 1 }}
        style={styles.header}
      >
        <View style={styles.iconContainer}>
          <Icon name="cached" type="material" color="white" size={60} />
        </View>
        <Text style={styles.headerTitle}>Clear Cache</Text>
        <Text style={styles.headerSubtitle}>Free up storage space</Text>
      </LinearGradient>

      <ScrollView style={styles.scrollView} showsVerticalScrollIndicator={false}>
        <View style={styles.content}>
          <Card containerStyle={styles.totalCard}>
            <View style={styles.totalHeader}>
              <Icon name="pie-chart" type="material" size={48} color={theme.colors.primary} />
              <View style={styles.totalInfo}>
                <Text style={styles.totalLabel}>Total Cache Size</Text>
                <Text style={styles.totalSize}>{formatBytes(cacheSize.total)}</Text>
              </View>
            </View>
            <Text style={styles.totalDescription}>
