              <Icon name="info" type="material" size={24} color="#2196F3" />
              <Text style={styles.infoTitle}>What is Cache?</Text>
            </View>
            <Text style={styles.infoText}>
              Cache stores temporary files to make the app load faster. Clearing it won't delete
              your personal data, but may temporarily slow down the app until the cache rebuilds.
            </Text>
          </Card>

          <View style={styles.section}>
            <Text style={styles.sectionTitle}>Cache by Category</Text>

            {cacheItems.map((item) => (
              <Card key={item.id} containerStyle={styles.cacheCard}>
                <View style={styles.cacheHeader}>
                  <View
                    style={[styles.cacheIconContainer, { backgroundColor: `${item.color}20` }]}
                  >
                    <Icon name={item.icon} type="material" size={32} color={item.color} />
                  </View>
                  <View style={styles.cacheInfo}>
                    <Text style={styles.cacheLabel}>{item.label}</Text>
                    <Text style={styles.cacheSize}>{formatBytes(item.size)}</Text>
                  </View>
                </View>
                <View style={styles.cacheProgress}>
                  <View style={styles.progressBar}>
                    <View
                      style={[
                        styles.progressFill,
                        {
                          backgroundColor: item.color,
                          width: `${Math.min((item.size / cacheSize.total) * 100, 100)}%`,
                        },
                      ]}
                    />
                  </View>
                  <Text style={styles.progressText}>
                    {Math.round((item.size / cacheSize.total) * 100)}%
                  </Text>
                </View>
                <Button
                  title={
                    clearing === item.type
                      ? 'Clearing...'
                      : `Clear ${item.label.replace(' Cache', '')}`
                  }
                  onPress={() => handleClearCache(item.type)}
                  disabled={clearing !== null || item.size === 0}
                  loading={clearing === item.type}
                  buttonStyle={[
                    styles.clearButton,
                    { backgroundColor: item.color },
                    item.size === 0 && styles.clearButtonDisabled,
                  ]}
                  containerStyle={styles.clearButtonContainer}
                  icon={
                    clearing !== item.type && (
                      <Icon
                        name="delete-sweep"
                        type="material"
                        color="white"
                        size={20}
                        containerStyle={{ marginRight: 10 }}
                      />
                    )
                  }
                />
              </Card>
            ))}
          </View>

          <Card containerStyle={styles.clearAllCard}>
            <View style={styles.clearAllHeader}>
              <Icon name="delete-forever" type="material" size={32} color="#F44336" />
              <Text style={styles.clearAllTitle}>Clear All Cache</Text>
            </View>
            <Text style={styles.clearAllDescription}>
              Clear all cached data at once. This includes images, app data, and documents cache.
            </Text>
            <Button
              title={clearing === 'all' ? 'Clearing All...' : 'Clear All Cache'}
              onPress={() => handleClearCache()}
              disabled={clearing !== null || cacheSize.total === 0}
              loading={clearing === 'all'}
              buttonStyle={styles.clearAllButton}
              containerStyle={styles.clearAllButtonContainer}
              icon={
                clearing !== 'all' && (
                  <Icon
                    name="cleaning-services"
                    type="material"
                    color="white"
                    size={20}
                    containerStyle={{ marginRight: 10 }}
                  />
                )
              }
            />
          </Card>

          <Card containerStyle={styles.tipsCard}>
            <Card.Title style={styles.tipsTitle}>Tips for Managing Cache</Card.Title>
            <Card.Divider />
            <View style={styles.tipRow}>
              <Icon
                name="lightbulb-outline"
                type="material"
                size={20}
                color={theme.colors.primary}
                containerStyle={styles.tipIcon}
              />
              <Text style={styles.tipText}>
                Clear cache regularly to maintain optimal app performance
              </Text>
            </View>
            <View style={styles.tipRow}>
              <Icon
                name="lightbulb-outline"
                type="material"
                size={20}
                color={theme.colors.primary}
                containerStyle={styles.tipIcon}
              />
              <Text style={styles.tipText}>
                Clearing cache won't affect your saved appointments or health data
              </Text>
            </View>
            <View style={styles.tipRow}>
              <Icon
                name="lightbulb-outline"
                type="material"
                size={20}
                color={theme.colors.primary}
                containerStyle={styles.tipIcon}
              />
              <Text style={styles.tipText}>
                The app may temporarily run slower after clearing cache
              </Text>
            </View>
            <View style={styles.tipRow}>
              <Icon
                name="lightbulb-outline"
                type="material"
                size={20}
                color={theme.colors.primary}
                containerStyle={styles.tipIcon}
              />
              <Text style={styles.tipText}>You'll need to re-download images and documents</Text>
            </View>
          </Card>

          <View style={styles.refreshContainer}>
            <Text style={styles.refreshText}>Cache information updated</Text>
            <Button
              title="Refresh"
              onPress={loadCacheSize}
              type="outline"
              buttonStyle={styles.refreshButton}
              titleStyle={styles.refreshButtonTitle}
              icon={
                <Icon
                  name="refresh"
                  type="material"
                  color={theme.colors.primary}
                  size={18}
                  containerStyle={{ marginRight: 8 }}
                />
              }
            />
          </View>
        </View>
      </ScrollView>
    </View>
  );
};

